import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <h2>Welcome!</h2>
      <p>Please <Link to="/login">log in</Link> or <Link to="/register">register</Link>.</p>
    </div>
  );
};

export default HomePage;
